import React from "react";
import "./About.css";

const About = () => {
  return (
    <div className="blog">
      <div className="blog-1">
        <h1 className="about">About Me</h1>
      </div>
      <div className="blog-2">
        <div>
          <h2><span className="blue">Hi! I'M SOHAIB HASSAN</span></h2>
        </div>
        <p>
        My name is Waleed Fahad Alenazi, I graduated from King Saud University with a bachelor's degree in Data Science - Computer Information Systems.

I've been ranked the number 1 student out of all students who graduated in my major in the same semester, with a 4.69 GPA and a second class honors.


I invest my free time learning new things, freelancing, and improve my skills with hands on experience.

I love programming, developing, building interesting things that make people's lives easier and fun.

I love learning new things and expand my knowledge, teaching and helping others, lead a team and work together.
        </p>
        <a href="#">
          Read more
        </a>
      </div>
    </div>
    
  );
};
export default About;
